import React from 'react';
import { Avatar, Card } from 'antd';

const UserProfile = () => {
    return (
        <Card
            action={[
                <div key="tweet">supersuper<br />0</div>,
                <div key="followings">버팔로윙<br />0</div>,
                <div key="followers">따라오는이들<br />0</div>,
            ]}
        >
            <Card.Meta 
                avatar={<Avatar>SC</Avatar>}
                title="supercoder"
            />
        </Card>
    );
}

export default UserProfile();
